def parse_date(date_text):
    match = re.search(r'(\d{1,2})\s+(\S+)\s+(\d{4})', date_text)
    if match:
        day, month_text, year = match.groups()
        month = RUS_MONTH.get(month_text.lower())
        if month:
            return f"{int(day):02d}.{month}.{year}"
    return None

def parse_html_file(html_file):
    with open(html_file, "r", encoding="utf-8") as f:
        soup = BeautifulSoup(f, "html.parser")
    span = soup.find("span", class_="text-center")
    trade_date = None
    if span:
        trade_date = parse_date(span.get_text())
    if not trade_date:
        print(f"Дата не найдена в файле {html_file}")
        return None, []
    table = soup.find("table", class_="table1 _full-width table1")
    if not table:
        print(f"Таблица не найдена в файле {html_file}")
        return trade_date, []
    data_rows = []
    for tr in table.find_all("tr"):
        tds = tr.find_all("td")
        if len(tds) == 6:
            title = tds[0].get_text(strip=True)
            title = title.replace("договоров (контрактов)", "контрактов")
            values = []
            for td in tds[1:]:
                txt = td.get_text(strip=True)
                txt = txt.replace("\xa0", "").replace(" ", "").replace(",", ".")
                try:
                    num = float(txt)
                except ValueError:
                    num = None
                values.append(num)
            if len(values) == 5:
                data_rows.append([title] + values)
    return trade_date, data_rows

def update_csv(csv_file, trade_date, rows, asset="MIX", lock=None):
    if lock:
        lock.acquire()
    try:
        if os.path.exists(csv_file):
            with open(csv_file, "r", newline="", encoding="utf-8") as f:
                reader = csv.reader(f)
                header = next(reader, None)
                for row in reader:
                    if row and row[0] == trade_date:
                        print(f"Запись с датой {trade_date} уже существует. Пропуск записи.")
                        return
        else:
            header = ["TradeDate", "Asset", "Title", "Long_fiz", "Short_fiz", "Long_jur", "Short_jur", "Total"]
            with open(csv_file, "w", newline="", encoding="utf-8") as f:
                writer = csv.writer(f)
                writer.writerow(header)
        with open(csv_file, "a", newline="", encoding="utf-8") as f:
            writer = csv.writer(f)
            for data in rows:
                writer.writerow([trade_date, asset] + data)
        print(f"Данные за {trade_date} добавлены в CSV.")
    finally:
        if lock:
            lock.release()

def fetch_and_save(date_str, csv_file, lock=None):
    url = "https://www.moex.com/ru/derivatives/open-positions-new.aspx/open-positions-csv.aspx"
    params = {
        "d": date_str,
        "t": "1"
    }
    headers = {
        "User-Agent": "Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 "
                      "(KHTML, like Gecko) Chrome/135.0.0.0 Safari/537.36 Edg/135.0.0.0",
        "Content-Type": "application/x-www-form-urlencoded",
    }
    target_dt = datetime.strptime(date_str, "%Y%m%d")
    adjusted_dt = target_dt - timedelta(days=1)
    day = adjusted_dt.day
    month = adjusted_dt.month
    year = adjusted_dt.year

    data = BODY_TEMPLATE.format(date=date_str, day=day, month=month, year=year)
    response = requests.post(url, params=params, headers=headers, data=data)
    if response.status_code == 200:
        html_content = response.content.decode("utf-8")
        trade_date, data_rows = parse_html_string(html_content)
        if trade_date and data_rows:
            update_csv(csv_file, trade_date, data_rows, lock=lock)
        else:
            print(f"Данные не извлечены за {date_str}")
    else:
        print(f"Ошибка запроса за {date_str}, статус-код: {response.status_code}")

def parse_html_string(html_string):
    soup = BeautifulSoup(html_string, "html.parser")
    span = soup.find("span", class_="text-center")
    trade_date = None
    if span:
        trade_date = parse_date(span.get_text())
    if not trade_date:
        print("Дата не найдена в HTML-контенте")
        return None, []
    table = soup.find("table", class_="table1 _full-width table1")
    if not table:
        print("Таблица не найдена в HTML-контенте")
        return trade_date, []
    data_rows = []
    for tr in table.find_all("tr"):
        tds = tr.find_all("td")
        if len(tds) == 6:
            title = tds[0].get_text(strip=True)
            title = title.replace("договоров (контрактов)", "контрактов")
            values = []
            for td in tds[1:]:
                txt = td.get_text(strip=True)
                txt = txt.replace("\xa0", "").replace(" ", "").replace(",", ".")
                try:
                    num = float(txt)
                except ValueError:
                    num = None
                values.append(num)
            if len(values) == 5:
                data_rows.append([title] + values)
    return trade_date, data_rows